import React, { Component } from "react";

class Toc extends Component {
  render() {
    // const lists = [];
    let data = this.props.data;

    data = data.map((el) => {
      return (
        <li key={el.id}>
          <a
            href={"/content/" + el.id}
            id={el.id}
            onClick={(e) => {
              e.preventDefault();
              this.props.onChangePage(e.target.id);
            }}
          >
            {el.title}
          </a>
        </li>
      );
    });

    return (
      <nav>
        <ul>{data}</ul>
      </nav>
    );
  }
}

export default Toc;
